description:
Den 15-arige Jim alskar utmaningar, nagot som det inte ar sarskilt gott om pa planeten Montressor dar han bor och framfor allt inte pa vardshuset dar han jobbar. Men nar han en dag far tag pa en stjarnkarta startar hans livs aventyr. Kartan visar en plats dar det finns en enorm skatt av guld och juveler. Folj nu med, du och hela familjen pa detta spektakulara aventyr.



